import styled from 'styled-components';

const AvatarStyle = styled.img`
  position: absolute;
  top: 210px;
  width: 180px;
  height: 180px;
  border: 4px solid #EA5D5D;
  filter: drop-shadow(0px 0px 9px #EA5D5D);
  border-radius: 104.412px;
  z-index: 2;
`;

export default AvatarStyle;
